// 

import React, { useEffect, useState } from "react";
import {
  Box,
  Grid,
  TextField,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Switch,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
} from "@mui/material";
import { styled } from "@mui/material/styles";
import CloseIcon from "@mui/icons-material/Close";
import DeleteIcon from "@mui/icons-material/Delete";
import EditIcon from "@mui/icons-material/Edit";
import { Formik, Form, Field } from "formik";
import axios from "axios";
import InteviewPortal from "./InteviewPortal";

const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": { padding: theme.spacing(2) },
  "& .MuiDialogActions-root": { padding: theme.spacing(1) },
}));

const Categary = () => {
  const [open, setOpen] = useState(false);
  const [checked, setChecked] = useState({});
  const [ini, setIni] = useState({ categoryName: "" });
  const [list, setList] = useState([]);
  const [editId, setEditId] = useState(null);
  const [serchcat, setSearchCat] = useState("");

  const handleClickOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  const handleSubmit = (values, { resetForm }) => {
    const url = editId
      ? `https://interviewback-ucb4.onrender.com/category/${editId}`
      : "https://interviewback-ucb4.onrender.com/category/create";
    const method = editId ? "patch" : "post";
    
    axios[method](url, values, {
      headers: { Authorization: "YOUR_TOKEN_HERE" },
    })
      .then(() => {
        dataView();
        resetForm();
        setEditId(null);
        handleClose();
      })
      .catch(console.error);
  };

  const dataView = () => {
    axios
      .get("https://interviewback-ucb4.onrender.com/category/", {
        headers: { Authorization: "YOUR_TOKEN_HERE" },
      })
      .then((res) => {
        setList(res.data.data);
        const statusObj = {};
        res.data.data.forEach((item) => (statusObj[item._id] = true));
        setChecked(statusObj);
      })
      .catch(console.error);
  };

  const deleteData = (id) => {
    axios
      .delete(`https://interviewback-ucb4.onrender.com/category/${id}`, {
        headers: { Authorization: "YOUR_TOKEN_HERE" },
      })
      .then(dataView)
      .catch(console.error);
  };

  const editData = (id, row) => {
    setIni(row);
    setEditId(id);
    handleClickOpen();
  };

  useEffect(() => {
    dataView();
  }, []);

  return (
    <InteviewPortal>
      <Grid container spacing={2} alignItems="center">
        <Grid item xs={12} sm={8} md={9} lg={10}>
          <TextField
            fullWidth
            value={serchcat}
            label="Search Category"
            onChange={(e) => setSearchCat(e.target.value)}
          />
        </Grid>
        <Grid item xs={12} sm={4} md={3} lg={2}>
          <Button
            fullWidth
            sx={{ backgroundColor: "#1976d2", color: "white" }}
            variant="contained"
            onClick={handleClickOpen}
          >
            ADD CATEGORY
          </Button>
        </Grid>
      </Grid>

      {/* Table Container */}
      <Box sx={{ width: "100%", overflowX: "auto", mt: 3 }}>
        <TableContainer component={Paper}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>No.</TableCell>
                <TableCell align="center">Category Name</TableCell>
                <TableCell align="center">Status</TableCell>
                <TableCell align="center">Delete</TableCell>
                <TableCell align="center">Update</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {list.map((row, i) => (
                <TableRow key={row._id}>
                  <TableCell>{i + 1}</TableCell>
                  <TableCell align="center">{row.categoryName}</TableCell>
                  <TableCell align="center">
                    <Switch
                      checked={checked[row._id] || false}
                      onChange={() =>
                        setChecked((prev) => ({ ...prev, [row._id]: !prev[row._id] }))
                      }
                    />
                  </TableCell>
                  <TableCell align="center">
                    <IconButton onClick={() => deleteData(row._id)}>
                      <DeleteIcon color="error" />
                    </IconButton>
                  </TableCell>
                  <TableCell align="center">
                    <IconButton onClick={() => editData(row._id, row)}>
                      <EditIcon color="primary" />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Box>

      {/* Add/Edit Dialog */}
      <BootstrapDialog open={open} onClose={handleClose}>
        <DialogTitle>
          {editId ? "Edit Category" : "Add Category"}
          <IconButton
            aria-label="close"
            onClick={handleClose}
            sx={{ position: "absolute", right: 8, top: 8 }}
          >
            <CloseIcon />
          </IconButton>
        </DialogTitle>
        <Formik enableReinitialize initialValues={ini} onSubmit={handleSubmit}>
          <Form>
            <DialogContent dividers>
              <Field as={TextField} name="categoryName" label="Category" fullWidth />
            </DialogContent>
            <DialogActions>
              <Button sx={{ backgroundColor: "#1976d2", color: "white" }} type="submit">
                Submit
              </Button>
            </DialogActions>
          </Form>
        </Formik>
      </BootstrapDialog>
    </InteviewPortal>
  );
};

export default Categary;
